contracts/Auction.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract Auction {
    string public description;
    string public instructions; // will be used for delivery address or email
    uint public price;
    bool public initialPrice = true; // at first asking price is OK, then +25% required
    uint public timestampEnd;
    address public beneficiary;
    bool public finalized = false;

    address public owner;
    address public winner;
    mapping(address => uint) public bids;
    address[] public accountsList; // so we can iterate: https://ethereum.stackexchange.com/questions/13167/are-there-well-solved-and-simple-storage-patterns-for-solidity

    uint public increaseTimeIfBidBeforeEnd = 24 * 60 * 60; // Naming things: https://www.instagram.com/p/BSa_O5zjh8X/
    uint public increaseTimeBy = 24 * 60 * 60;

    event BidEvent(
        address indexed winner,
        uint indexed price,
        uint indexed timestamp
    );
    event Refund(address indexed addr, uint value, uint timestamp);

    modifier onlyOwner() {
        require(owner == msg.sender, "only owner");
        _;
    }

    modifier onlyWinner() {
        require(winner == msg.sender, "only winner");
        _;
    }

    modifier ended() {
        require(block.timestamp > timestampEnd, "not ended yet");
        _;
    }

    function setDescription(string memory _description) public onlyOwner {
        description = _description;
    }

    function setInstructions(
        string memory _instructions
    ) public ended onlyWinner {
        instructions = _instructions;
    }

    constructor(
        uint _price,
        string memory _description,
        uint _timestampEnd,
        address _beneficiary
    ) {
        require(
            _timestampEnd > block.timestamp,
            "end of the auction must be in the future"
        );
        owner = msg.sender;
        price = _price;
        description = _description;
        timestampEnd = _timestampEnd;
        beneficiary = _beneficiary;
    }

    receive() external virtual payable {
        if (msg.value == 0) {
            refund();
            return;
        }

        require(block.timestamp < timestampEnd, "auction has ended");

        if (bids[msg.sender] > 0) {
            bids[msg.sender] += msg.value;
        } else {
            bids[msg.sender] = msg.value;
            accountsList.push(msg.sender);
        }

        if (initialPrice) {
            require(
                bids[msg.sender] >= price,
                "bid too low, minimum is the initial price"
            );
        } else {
            require(
                bids[msg.sender] >= ((price * 5) / 4),
                "bid too low, minimum 25% increment"
            );
        }

        if (block.timestamp > timestampEnd - increaseTimeIfBidBeforeEnd) {
            timestampEnd = block.timestamp + increaseTimeBy;
        }

        initialPrice = false;
        price = bids[msg.sender];
        winner = msg.sender;
        emit BidEvent(winner, price, block.timestamp);
    }

    function finalize() virtual public ended onlyOwner {
        require(!finalized, "can withdraw only once");
        require(!initialPrice, "can withdraw only if there were bids");

        finalized = true;
        payable(beneficiary).transfer(price);
    }

    function refundContributors() public ended onlyOwner {
        bids[winner] = 0; // setting it to zero that in the refund loop it is skipped
        for (uint i = 0; i < accountsList.length; i++) {
            if (bids[accountsList[i]] > 0) {
                uint refundValue = bids[accountsList[i]];
                bids[accountsList[i]] = 0;
                payable(accountsList[i]).transfer(refundValue);
            }
        }
    }

    function refund() virtual public {
        require(msg.sender != winner, "winner cannot refund");
        require(
            bids[msg.sender] > 0,
            "refunds only allowed if you sent something"
        );

        uint refundValue = bids[msg.sender];
        bids[msg.sender] = 0; // reentrancy fix, setting to zero first
        payable(msg.sender).transfer(refundValue);

        emit Refund(msg.sender, refundValue, block.timestamp);
    }
}

contracts/AuctionMultiple.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./Auction.sol";

contract AuctionMultiple is Auction {
    uint256 public constant LIMIT = 2000;
    uint256 public constant HEAD = 120000000 * 1e18;
    uint256 public constant TAIL = 0;
    uint256 public lastBidID = 0;
    uint256 public acceptedBids = 0;
    uint256 public howMany;

    struct Bid {
        uint256 prev;
        uint256 next;
        uint256 value;
        address contributor;
    }

    mapping(uint256 => Bid) public multipleBids;
    mapping(address => uint256) public contributors;

    event LogNumber(uint256 number);
    event LogText(string text);
    event LogAddress(address addr);

    constructor(
        uint256 _price,
        string memory _description,
        uint256 _timestampEnd,
        address _beneficiary,
        uint256 _howMany
    ) Auction(_price, _description, _timestampEnd, _beneficiary) {
        require(
            _howMany > 1,
            "This auction is suited to multiple items. With 1 item only - use different code. Or remove this 'require' - you've been warned"
        );
        howMany = _howMany;

        multipleBids[HEAD] = Bid({
            prev: TAIL,
            next: TAIL,
            value: HEAD,
            contributor: address(0)
        });
        multipleBids[TAIL] = Bid({
            prev: HEAD,
            next: HEAD,
            value: TAIL,
            contributor: address(0)
        });
    }

    receive() external payable virtual override {
        if (msg.value == 0) {
            refund();
        } else {
            bid();
        }
    }

    function bid() public payable {
        require(
            block.timestamp < timestampEnd,
            "cannot bid after the auction ends"
        );

        uint256 myBidId = contributors[msg.sender];
        uint256 insertionBidId;

        if (myBidId > 0) {
            Bid storage existingBid = multipleBids[myBidId];
            existingBid.value += msg.value;

            if (existingBid.value > multipleBids[existingBid.next].value) {
                insertionBidId = searchInsertionPoint(
                    existingBid.value,
                    existingBid.next
                );

                multipleBids[existingBid.prev].next = existingBid.next;
                multipleBids[existingBid.next].prev = existingBid.prev;

                existingBid.prev = insertionBidId;
                existingBid.next = multipleBids[insertionBidId].next;

                multipleBids[multipleBids[insertionBidId].next].prev = myBidId;
                multipleBids[insertionBidId].next = myBidId;
            }
        } else {
            require(
                msg.value >= price,
                "Not much sense sending less than the price, likely an error"
            );
            require(
                lastBidID < LIMIT,
                "Due to blockGas limit we limit number of people in the auction to 2000"
            );

            lastBidID++;
            acceptedBids++;

            insertionBidId = searchInsertionPoint(msg.value, TAIL);

            contributors[msg.sender] = lastBidID;

            multipleBids[lastBidID] = Bid({
                prev: insertionBidId,
                next: multipleBids[insertionBidId].next,
                value: msg.value,
                contributor: msg.sender
            });

            multipleBids[multipleBids[insertionBidId].next].prev = lastBidID;
            multipleBids[insertionBidId].next = lastBidID;
        }
    }

    function searchInsertionPoint(
        uint256 _contribution,
        uint256 _startSearch
    ) public view returns (uint256 insertionPoint) {
        require(
            _contribution > multipleBids[_startSearch].value,
            "your contribution and _startSearch does not make sense, it will search in a wrong direction"
        );

        Bid memory lowerBid = multipleBids[_startSearch];
        Bid memory higherBid;

        while (true) {
            higherBid = multipleBids[lowerBid.next];

            if (_contribution < higherBid.value) {
                return higherBid.prev;
            } else {
                lowerBid = higherBid;
            }
        }
    }

    function getPosition(address addr) public view returns (uint256) {
        uint256 bidId = contributors[addr];
        require(
            bidId != 0,
            "cannot ask for a position of a guy who is not on the list"
        );
        uint256 position = 1;

        Bid memory currentBid = multipleBids[HEAD];

        while (currentBid.prev != bidId) {
            currentBid = multipleBids[currentBid.prev];
            position++;
        }
        return position;
    }

    function getPosition() public view returns (uint256) {
        return getPosition(msg.sender);
    }

    function refund() public override {
        refund(msg.sender);
    }

    function refundOnBehalf(address addr) public onlyOwner {
        refund(addr);
    }

    function refund(address addr) private {
        uint256 bidId = contributors[addr];
        require(
            bidId > 0,
            "the guy with this address does not exist, makes no sense to withdraw"
        );
        uint256 position = getPosition(addr);
        require(
            position > howMany,
            "only the non-winning multipleBids can be withdrawn"
        );

        Bid memory thisBid = multipleBids[bidId];
        multipleBids[thisBid.prev].next = thisBid.next;
        multipleBids[thisBid.next].prev = thisBid.prev;

        delete multipleBids[bidId];
        delete contributors[addr];

        acceptedBids--;
        emit Refund(addr, thisBid.value, block.timestamp);
        payable(addr).transfer(thisBid.value);
    }

    function finalize() public virtual override ended onlyOwner {
        require(
            finalized == false,
            "auction already finalized, can withdraw only once"
        );
        finalized = true;

        uint256 sumContributions = 0;
        uint256 counter = 0;
        Bid memory currentBid = multipleBids[HEAD];
        while (counter++ < howMany && currentBid.prev != TAIL) {
            currentBid = multipleBids[currentBid.prev];
            sumContributions += currentBid.value;
        }

        payable(beneficiary).transfer(sumContributions);
    }
}

contracts/AuctionMultipleGuaranteed.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./AuctionMultiple.sol";

// For instance: offering limited "Early Bird" tickets that are guaranteed
contract AuctionMultipleGuaranteed is AuctionMultiple {
    uint public howManyGuaranteed;
    uint public priceGuaranteed;
    address[] public guaranteedContributors;
    mapping(address => uint) public guaranteedContributions;

    event GuaranteedBid(address addr, uint value);

    constructor(
        uint _price,
        string memory _description,
        uint _timestampEnd,
        address _beneficiary,
        uint _howMany,
        uint _howManyGuaranteed,
        uint _priceGuaranteed
    )
        AuctionMultiple(
            _price,
            _description,
            _timestampEnd,
            _beneficiary,
            _howMany
        )
    {
        require(
            _howMany >= _howManyGuaranteed,
            "The number of guaranteed items should be less or equal than total items. If equal = fixed price sell, kind of OK with me"
        );
        require(
            _priceGuaranteed > 0,
            "Guaranteed price must be greater than zero"
        );

        howManyGuaranteed = _howManyGuaranteed;
        priceGuaranteed = _priceGuaranteed;
    }

    receive() external payable override {
        if (msg.value == 0) {
            refund();
        } else {
            require(
                block.timestamp < timestampEnd,
                "cannot bid after the auction ends"
            );
            require(
                guaranteedContributions[msg.sender] == 0,
                "already a guaranteed contributor, cannot more than once"
            );

            if (msg.value >= priceGuaranteed && howManyGuaranteed > 0) {
                guaranteedContributors.push(msg.sender);
                guaranteedContributions[msg.sender] = msg.value;
                howManyGuaranteed--;
                howMany--;
                emit GuaranteedBid(msg.sender, msg.value);
            } else {
                bid();
            }
        }
    }

    function finalize() public override ended onlyOwner {
        require(
            !finalized,
            "auction already finalized, can withdraw only once"
        );
        finalized = true;

        uint sumContributions = 0;
        uint counter = 0;
        Bid memory currentBid = multipleBids[HEAD];
        while (counter++ < howMany && currentBid.prev != TAIL) {
            currentBid = multipleBids[currentBid.prev];
            sumContributions += currentBid.value;
        }

        for (uint i = 0; i < guaranteedContributors.length; i++) {
            sumContributions += guaranteedContributions[
                guaranteedContributors[i]
            ];
        }

        (bool success, ) = beneficiary.call{value: sumContributions}("");
        require(success, "Transfer failed.");
    }
}

